import './index.css';
import Header from './Header';
import reportWebVitals from './reportWebVitals';
import './Header.css';
import './Carousel';
import Contador from './Contador';
<link rel="stylesheet" href="https://use.fontawesome.com/releases/v5.15.3/css/all.css" integrity="sha384-DfzL+gJZzkzLvM6+5uBz63bB+lVE2WRfX8W57FzvZ5TC5Sz2mAW+aGvDyIaA/N5a" crossorigin="anonymous"></link>

ReactDOM.render(
  <React.StrictMode>
    <div>
    <Header title="" />
    </div>

    <div>
    <Slider/>
    <Contador/>
    <Slider/>
    </div>
    <h1>Eventos recientes</h1>

  </React.StrictMode>

   ,
  document.getElementById('root')
);

reportWebVitals();
